import styled from "styled-components"
import logo from "../img/logo.png"

const HeaderBox = styled.header`
border-color: 1px solid black;
float: left;

`


const Header = () => {
    return (
            
            <HeaderBox>
                <img src={logo}/> 
                
                
            </HeaderBox>
        
    )
}

export default Header;
